import React from "react";
import "./body_cart.css";
import { useState, useEffect } from "react";
import axios from "axios";

const Body_cart = () => {
  const [showApi, setShowApI] = useState([]);

  useEffect(() => {
    axios
      .get("https://fakestoreapi.com/products")
      .then((res) => {
        setShowApI(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      <div>
        {showApi.map((showdata) => {
          return (
            <div
              className="data_div"
              key={showdata.id}
            >
                {showdata.title}
                {showdata.price}
                <div>{showdata.category}</div>
                <div>{showdata.description}</div>
                <div>{showdata.rate}</div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Body_cart;
